*
"Full of misgivings, a young woman (Jessie Buckley) travels with her new boyfriend (Jesse Plemons) to his parents' secluded farm."
*
Hoo buddy, how do I even describe this film? Like a more palatable David Lynch? In fact, there is a dinner scene in this film that gave me the same creeped out, wtf is going on feeling as the dinner scene in Eraserhead. This movie is strange, philosophical, uneasy, with shifting relationships, personalities, surreal scenes, bizarre interactions.

It's, uh... it's a lot. I wouldn't say that I enjoyed watching it, because I didn't like the way it make me feel, but it's definitely one of those movies that will stick with you for a while.

Both Buckley and Plemons (but especially Buckley) are great in this.
